import { GetTopicsService } from '.'
import { TopicData } from '../protocols'
import { GetTopicsUseCase } from './GetTopicsUseCase'

function createGetTopicsUseCase(service: GetTopicsService): GetTopicsUseCase {
  return function (token): Promise<TopicData[]> {
    return service.getTopics(token)
  }
}

export { createGetTopicsUseCase }
